import { useState } from "react";
import Main from "./Main";

const Home = () => {
  const [dataBlog, setData] = useState([
    { title: "first section", author: "alex", id: 1 },
    { title: "second section", author: "alex", id: 1 },
    { title: "third section", author: "alex", id: 1 },
  ]);

  return (
    <div className="home" key={dataBlog.id}>
      <p>HOME</p>

      <Main dataBlog={dataBlog} />
    </div>
  );
};
export default Home;
